import { View, Text, StyleSheet, ImageBackground, Image, Modal, Pressable, TouchableOpacity, TouchableWithoutFeedback } from 'react-native'
import React, { useState } from 'react'
import HeaderBgImage from "../images/loginBg.jpg";
import { AntDesign } from '@expo/vector-icons'; 
import BottomNavigation from '../components/component/Bottom-navigation';
import BtnEquipment from '../components/button/Btn-equipment';
import { TextInput } from 'react-native-gesture-handler';

export default function DraftQuotation() {
  return (
    <View style={styles.container}>
    <View style={styles.quotationTopCotainer}>
       <ImageBackground source={HeaderBgImage} resizeMode="cover" style={{flex:1}}>
           <View style={styles.titleContainer}>
               <Text style={styles.hireTitle}>THE LARGEST</Text>
               <Text style={styles.hireTitle}>EQUIPMENT RENTAL NETWORK</Text>
           </View>
       </ImageBackground>
    </View>
    <View style={styles.draftQuotationArea}>
          <View>
             <Text style={styles.draftTitle}>Draft Quotation</Text>
          </View>
          <View>
            <Text>To</Text>
            <Text>Sahadat Hossain</Text>
          </View>
    </View>
     <View style={styles.quotationBottomArea}>
            <BottomNavigation />
     </View>
</View>
  )
}


const styles = StyleSheet.create({
    container:{
        flex:1,
        backgroundColor:"#F7F7F7"
       },
       quotationTopCotainer:{
         flex:0.5,
         borderBottomRightRadius:40,
         borderBottomLeftRadius:40,
         overflow:"hidden"
       },
       quotationArea:{
         flex:1,
         alignItems:"center",
       },
       titleContainer:{
           flex:1,
           justifyContent:"center",
           alignItems:"center"
       },
       hireTitle:{
           fontSize:15,
           textAlign:"center",
           color:"#fff",
           
       },
       draftTitle:{
        fontSize:25,
        color:"#f6921e",
        textTransform:"uppercase",
        marginTop:15
       }
})
